import{_ as e,o as a,c as r,O as o}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 63.2-106 Failure to obey subpoena or charging illegal fees; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-106.md","filePath":"vacode/63.2-106.md"}'),t={name:"vacode/63.2-106.md"},l=o('<h1 id="§-63-2-106-failure-to-obey-subpoena-or-charging-illegal-fees-penalty" tabindex="-1">§ 63.2-106 Failure to obey subpoena or charging illegal fees; penalty. <a class="header-anchor" href="#§-63-2-106-failure-to-obey-subpoena-or-charging-illegal-fees-penalty" aria-label="Permalink to &quot;§ 63.2-106 Failure to obey subpoena or charging illegal fees; penalty.&quot;">​</a></h1><p>If any person fails or refuses to obey any subpoena issued under the provisions of § <a href="http://law.lis.virginia.gov/vacode/63.2-220/" target="_blank" rel="noreferrer">63.2-220</a> or § <a href="http://law.lis.virginia.gov/vacode/63.2-322/" target="_blank" rel="noreferrer">63.2-322</a>, or charges or receives any fee contrary to the provisions of § <a href="http://law.lis.virginia.gov/vacode/63.2-508/" target="_blank" rel="noreferrer">63.2-508</a>, he shall be guilty of a Class 1 misdemeanor.</p><p>Code 1950, §§ 63-139, 63-160, 63-203, 63-219; 1968, c. 578, § 63.1-125; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>.</p>',3),i=[l];function n(s,c,p,_,f,g){return a(),r("div",null,i)}const u=e(t,[["render",n]]);export{d as __pageData,u as default};
